--
-- Create procedure `usermiac`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE usermiac (var_surname text)
BEGIN
  SELECT
    e.surname 'Фамилия',
    e.name 'Имя',
    e.patronymic 'Отчество',
    p.name_post 'Должность',
    e.phone_number 'Номер телефона',
    e.gender 'Пол',
    e.education 'Образование',
    u.login 'Логин',
    u.`e-mail`,
    mi.name_institution 'Мед. учреждение',
    d.name_district 'Область',
    c.name_city 'Город',
    r.name_region 'Регион'
  FROM employees e
    LEFT JOIN user u
      ON e.id_user = u.id
    LEFT JOIN medical_institution mi
      ON mi.id = u.id_medical_institution
    LEFT JOIN district d
      ON d.id = u.id_district
    LEFT JOIN post p
      ON p.id = e.id_post
    LEFT JOIN city c
      ON c.id = d.id_name_city
    LEFT JOIN region r
      ON r.id = c.id_name_region
  WHERE e.surname LIKE CONCAT(var_surname, '%')
  ;
END
$$

