-- Create procedure `authorization`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE authorization (log text, pass text)
BEGIN

  SET SESSION TRANSACTION ISOLATION LEVEL READ COMMITTED;
  --	SET SESSION BINLOG_FORMAT = 'ROW';

  DROP TEMPORARY TABLE IF EXISTS tmp_authorization;
  CREATE TEMPORARY TABLE tmp_authorization (
    id int,
    login varchar(255),
    password varchar(255),
    acces_name varchar(255),
    surname varchar(255),
    name varchar(255),
    name_post varchar(255)
  );

    SELECT
      u.id,
      u.login,
      u.password,
      al.acces_name,
      e.surname,
      e.name,
      p.name_post
    FROM user u
      JOIN employees e
        ON e.id_user = u.id
      JOIN post p
        ON p.id = e.id_post
      JOIN post_acces_level pal
        ON pal.id_post = p.id
      JOIN acces_level al
        ON al.id = pal.id_acces_level
    WHERE u.login = log
    AND u.password = pass
  ;

  -- DROP TEMPORARY TABLE IF EXISTS tmp_authorization;

  SET SESSION TRANSACTION ISOLATION LEVEL REPEATABLE READ;
--	SET SESSION BINLOG_FORMAT = 'MIXED';
END
$$

