--
-- Create procedure `Adminka_statistics_test`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Adminka_statistics_test (IN var_surname varchar(255), IN var_name varchar(255), IN var_diagnosis varchar(255))
BEGIN


  SELECT STRAIGHT_JOIN
    p.id '№',
    d1.name_of_diagnosis 'Диагноз',
    p.surname 'Фамилия',
    p.name 'Имя',
    p.patronymic 'Отчество',
    p.phone_number 'Номер телефона',
    p.gender 'Пол',
    d.name_district 'Область',
    c.name_city 'Город',
    r.name_region 'Район',
    p.inn 'ИНН',
    p.passport 'Пасспорт',
    p.dt_birthday 'День рождения'
  FROM graduationwork.patient p
    JOIN graduationwork.district d
      ON d.id = p.id_district
    JOIN graduationwork.city c
      ON c.id = p.id_city
    JOIN graduationwork.region r
      ON r.id = p.id_region
    LEFT JOIN conclusion c1
      ON c1.id_patient = p.id
    LEFT JOIN diagnosis d1
      ON d1.id = c1.id_diagnosis
  WHERE p.surname LIKE CONCAT(var_surname, '%')
  AND p.name LIKE CONCAT(var_name, '%')
  AND d1.name_of_diagnosis LIKE CONCAT(var_diagnosis, '%')
  ;
END
$$

