DELIMITER $$

--
-- Create procedure `test`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE test (IN var_district varchar(255), IN var_date varchar(255))
BEGIN
  SELECT STRAIGHT_JOIN
    csd.number_of_people 'Количество обращений',
    d.name_of_diagnosis 'Диагноз',
    csd.gender 'Пол',
    csd.datetime_period 'Дата',
    d2.name_district 'Область'
  FROM convolution_statistics_diagnosis csd
    JOIN diagnosis d
      ON d.id = csd.id_diagnosis
    JOIN district d2
      ON d2.id = csd.id_district
  WHERE csd.datetime_period LIKE CONCAT(var_date, '%')
  AND d2.name_district LIKE CONCAT(var_district, '%')
  ;

END
$$

--
-- Create procedure `convolution_sd`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE convolution_sd ()
BEGIN
  SET SESSION TRANSACTION ISOLATION LEVEL READ COMMITTED;
  --	SET SESSION BINLOG_FORMAT = 'ROW';

    SELECT
      COUNT(c.id_patient),
      c.id_diagnosis,
      p.gender,
      c.dt_receipt,
      d1.id_name_city
    FROM conclusion c
      JOIN patient p
        ON p.id = c.id_patient
      JOIN district d1
        ON d1.id = p.id_district
      JOIN constant c1
        ON c1.id = 1
    WHERE c.dt_receipt >= c1.value
    GROUP BY c.id_diagnosis,
             d1.id,
             p.gender;

  UPDATE constant c
  SET id = 1,
      value = NOW()
  WHERE id = 1;
  SET SESSION TRANSACTION ISOLATION LEVEL REPEATABLE READ;
--	SET SESSION BINLOG_FORMAT = 'MIXED';
END
$$

DELIMITER ;

